Question: Express as a common fraction the reciprocal of $0.\overline7$.
Choices:
A. \frac{7}{2}
B. \frac{7}{9}
C. \frac{9}{2}
D. \frac{9}{7}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: Sam has $\frac{5}{8}$ of a pound of chocolate. If he eats $\frac{1}{3}$ of the chocolate he has, how many pounds of chocolate does he eat?
Choices:
A. \frac{5}{12}
B. \frac{5}{24}
C. \frac{3}{24}
D. \frac{3}{24}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: The procedure below is intended to display the index in a list of unique names (nameList) where a particular name (targetName) is found. lf targetName is not found in nameList, the code should display 0.
 PROCEDURE FindName (nameList, targetName)
 {
  index ← 0
  FOR EACH name IN nameList
  {
   index ← index + 1
   IF (name = targetName)
   {
   foundIndex ← index
   }
   ELSE
   {
   foundIndex ← 0
   }
  }
  DISPLAY (foundIndex)
 }
 Which of the following procedure calls can be used to demonstrate that the procedure does NOT Work as intended?
Choices:
A. FindName (["Andrea", "Ben"], "Ben" )
B. FindName (["Andrea", "Ben" ], "Diane" )
C. FindName (["Andrea", "Ben", "Chris"], "Ben")
D. FindName (["Andrea", "Chris", "Diane"], "Ben")

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: Solve for $x$: $(-\frac{1}{3})(-4 -3x)=\frac{1}{2}$
Choices:
A. -\frac{5}{6}
B. \frac{7}{6}
C. \frac{5}{3}
D. \frac{1}{6}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: 3 cards are chosen at random from a standard 52-card deck. What is the probability that they form a pair? (A 3-card hand is a 'pair' if two of the cards match in rank but the third card is different. For example, 668 is a pair, but 999 is not.)
Choices:
A. \frac{1}{8}
B. \frac{1}{36}
C. \frac{1}{78}
D. \frac{72}{425}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: Let l = [1,2,2,3,4]. In Python3, what is a possible output of set(l)?
Choices:
A. {1}
B. {1,2,2,3,4}
C. {1,2,3,4}
D. {4,3,2,2,1}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: John has five children. What is the probability that at least half of them are girls? (We can assume a boy is equally likely to be born as is a girl, and vice-versa.)
Choices:
A. \frac{1}{2}
B. \frac{1}{4}
C. \frac{1}{8}
D. \frac{3}{5}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: A point in space $(x,y,z)$ is randomly selected so that $-1\le x \le 1$,$-1\le y \le 1$,$-1\le z \le 1$. What is the probability that $x^2+y^2+z^2\le 1$?
Choices:
A. \frac{\pi}{24}
B. \frac{\pi}{12}
C. \frac{\pi}{6}
D. \frac{\pi}{3}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: Bob rolls a fair six-sided die each morning. If Bob rolls a composite number, he eats sweetened cereal. If he rolls a prime number, he eats unsweetened cereal. If he rolls a 1, then he rolls again. In a non-leap year, what is the expected number of times Bob will roll his die?
Choices:
A. \frac{5}{8}
B. \frac{1825}{4}
C. \frac{5}{4}
D. 438

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: At breakfast, lunch, and dinner, Joe randomly chooses with equal probabilities either an apple, an orange, or a banana to eat. On a given day, what is the probability that Joe will eat at least two different kinds of fruit?
Choices:
A. \frac{7}{9}
B. \frac{8}{9}
C. \frac{5}{9}
D. \frac{9}{11}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: What is the inverse of $f(x)=4-5x$?
Choices:
A. \frac{5}{x-4}
B. \frac{x-4}{5}
C. \frac{x+4}{5}
D. -\frac{x-4}{5}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: Any set of Boolean operators that is sufficient to represent all Boolean expressions is said to be complete. Which of the following is NOT complete?
Choices:
A. {AND, NOT}
B. {NOT, OR}
C. {AND, OR}
D. {NAND}

Please select the correct answer from the choices above and explain your reasoning in detail.

Question: If the ratio of $2x-y$ to $x+y$ is 2 to 3, what is the ratio of $x$ to $y$? Express your answer as a common fraction.
Choices:
A. \frac{5}{4}
B. \frac{4}{5}
C. \frac{5}{2}
D. \frac{2}{5}

Please select the correct answer from the choices above and explain your reasoning in detail.
